description:
Lateef died 23 Dec 2013 at 93.  He seemed to have a peaceful existence.

This torrent is comprisedof a single piece I have treasured since
I first heard it on KUSC 30 years ago -- it was the Saturday Jazz
Radio Show's opening and closing theme song.

This piece is quite different than most of Lateef's work and swing or bop jazz in general.

It is a ethno-folk-jazz fusion piece blending traditional Japanese music.

